B.Ej=new A.rz("assets/logo_stiki.png","STIKI (Sekolah Tinggi Informatika dan Komputer Indonesia)","2020","Now","Information Technology",'In STIKI i learn about information technology, programming, and networking. I also learn more and deeper about web development, mobile development, and desktop development. And for my final project in STIKI i choose a topic to develop a mobile chatbot application "VITA" this app using API from OpenAI to help user solve their programming problem.',null)
B.En=new A.jc("Software Engineer","PT. Quipper Edukasi Indonesia","June 2021","April 2023","          Upon joining Quipper, I was assigned to the iOS team tasked with developing a new mobile application from the ground up. This involved utilizing Kotlin Multiplatform (KMM) for cross-platform logic and SwiftUI for building a native user interface.  My responsibilities included implementing key features and maintaining a high standard of code quality by writing unit tests and proactively addressing code smells with the assistance of SonarCloud. This application has been successfully released on the App Store.\n\nStack used : \n- Kotlin Multiplatform (KMM)\n- Swift\n- SwiftUI\n- SonarCloud\n- Firebase(Crashlytics, Remote Config)\n- XCode Organizer metrics\n- Unit Test\n- CI/CD\n- Github\n- JIRA","assets/quipper_logo.jpeg",null)
B.Eo=new A.jc("Senior Frontend Developer","PT. Living Fitness Indonesia","Sep 2023","Present","          Currently employed at LIF (Living in Fitness), a company providing corporate wellness programs. These programs promote healthy lifestyles by tracking employee activity through wearable devices like the Actxa Spark, Apple Watch, Huawei Watch, and Garmin. To further encourage engagement, LIF offers challenges that motivate users to exceed their typical activity levels. By achieving these goals, users earn reward points redeemable for incentives such as e-money, mobile phone credit, and e-vouchers. Initially joined LIF through Sagara Technology as an outsourced programmer before transitioning to a full-time role as a Senior Front-End Developer.  In this capacity, I have been responsible for developing their new Flutter application, contributing features such as user login and registration, fitness tracker integration (including Apple Health), challenge and reward systems, surveys, quizzes, and event check-in functionality. The LIF app is available on both the Google Play Store and Apple App Store.\n\nStack used:\n- Flutter \n- Dio\n- Shared Preferences\n- Sentry\n- Bluetooth Integration\n- Firebase(App Distribution, Remote Config)\n- Gemini AI\n- Bitbucket\n- Jira\n          ","assets/lif_indonesia_logo.jpeg",null)
B.Ep=new A.jc("Deep Trainee","PT. Aero Systems Indonesia","Jul 2018","Jul 2019","          Selected for a Deep Trainee position at PT. Aero Systems Indonesia (Asyst) through a competitive recruitment program conducted at my school. The comprehensive three-month training program provided a strong foundation in programming languages and the company's technology stack, including Java, Codeigniter, and Android Java. Following the training, I joined the mobile development team, focusing on creating cross-platform applications using React Native.  My initial project was a bespoke mobile booking application exclusively for Garuda Indonesia employees. This application, built with React Native, Redux, and SVN for version control, streamlined the booking process for internal users. Project management and issue tracking were facilitated through Jira.\n\nStack used : \n- React Native\n- Redux\n- SVN (Subversion Versioning)\n- JIRA","assets/pt_aero_systems_indonesia_logo.jpeg",null)
B.Eq=new A.jc("Flutter Engineer","Sagara Technology","Jul 2023","Sep 2023","          Initially joined Sagara Technology as an outsourced programmer dedicated to their client, LIF.  During this three-month engagement, I contributed to the modernization of their mobile application by migrating it from React Native to Flutter. Subsequently, I transitioned to a full-time position at LIF.","assets/logo_sagara.jpeg",null)
B.Er=new A.jc("Mobile Engineer","PT. Majoo Teknologi Indonesia","Aug 2019","June 2021","          As a Mobile Engineer at Majoo, I spearheaded the development of a new Flutter application for smartphones, complementing their existing tablet app. This role provided my first opportunity to gain expertise in Flutter, which I embraced enthusiastically. As a key member of the development team, I built features from the ground up, including Bluetooth printing, PIN screen security, wallet payments, and e-commerce integration. Notably, I developed a custom printer integration solution due to the lack of available packages at the time. This application is now available on the Google Play Store.\n\nStack used : \n- Flutter\n- Dart\n- Firebase(App Distribution, Remote Config)\n- Bluetooth\n- Dio\n- Sqflite\n- RabbitMq\n- Shared Preferences\n- Bitbucket","assets/majoo_indonesia_logo.jpeg",null)
